var t=Ember.HTMLBars.template({id:"591ViGRE",block:'{"symbols":[],"statements":[[7,"div"],[11,"class","docs-md"],[9],[7,"h1"],[11,"id","why-yeti-table-"],[11,"class","docs-md__h1"],[9],[0,"Why Yeti Table?"],[10],[0,"\\n    "],[7,"p"],[9],[0,"Perhaps the biggest difference compared to other table solution is that Yeti Table uses templates to define your columns.\\nIn many other table solutions you need to define columns in javascript.\\nYeti Table was born from an experimentation of trying to define columns in templates."],[10],[0,"\\n"],[7,"p"],[9],[0,"In practice, this empowers customization and feels more in line with writing regular HTML tables.\\nThis fact has many implications on the whole API of Yeti Table."],[10],[0,"\\n"],[7,"p"],[9],[0,"What most people are probably thinking is how Yeti Table compares to the great "],[7,"a"],[11,"href","https://github.com/Addepar/ember-table"],[11,"class","docs-md__a"],[9],[0,"Ember Table"],[10],[0," addon."],[10],[0,"\\n"],[7,"p"],[9],[0,"First of all, let me clarify that Ember Table is "],[7,"strong"],[9],[0,"amazing"],[10],[0," and in fact Yeti Table borrowed "],[7,"strong"],[9],[0,"a lot"],[10],[0," of good lessons from it. So, a big thank you to all of its contributors. "],[10],[0,"\\n"],[7,"p"],[9],[0,"At the time of writing, Ember Table still has some more advanced features that Yeti Table doesn\'t, so you might want to check their excellent documentation site to find out if you need such features. However, Yeti Table also has some nice features that Ember Table hasn\'t."],[10],[0,"\\n"],[7,"p"],[9],[0,"Yeti Table was also inpired by "],[7,"a"],[11,"href","https://datatables.net/"],[11,"class","docs-md__a"],[9],[0,"DataTables"],[10],[0," in a lot of its features."],[10],[0,"\\n\\n      "],[7,"h2"],[11,"id","features"],[11,"class","docs-md__h2"],[9],[7,"a"],[11,"href","#features"],[11,"class","heading-anchor"],[9],[0,"Features"],[10],[10],[0,"\\n    "],[7,"p"],[9],[0,"Yeti Table was built with the needs of a real production app in mind. Out of the box, it supports:"],[10],[0,"\\n"],[7,"ul"],[9],[0,"\\n"],[7,"li"],[9],[7,"strong"],[9],[0,"Client side row sorting"],[10],[0," - On a single column or on multiple columns."],[10],[0,"\\n"],[7,"li"],[9],[7,"strong"],[9],[0,"Client side row filtering"],[10],[0," - You can apply a global filter to the table or just to specific columns."],[10],[0,"\\n"],[7,"li"],[9],[7,"strong"],[9],[0,"Client side pagination"],[10],[0," - Provides pagination controls, but encourages you to build your own as well."],[10],[0,"\\n"],[7,"li"],[9],[7,"strong"],[9],[0,"Server side data"],[10],[0," - Allows your server to drive the table pagination, filtering and sorting if you choose to. Useful when the dataset is too large to fetch."],[10],[0,"\\n"],[7,"li"],[9],[7,"strong"],[9],[0,"Customization"],[10],[0," - Does not provide any styles. You can customize pretty much everything about how the tables are rendered on your templates. This includes custom css classes, click handlers and custom filtering and sorting logic."],[10],[0,"\\n"],[10],[0,"\\n\\n      "],[7,"h2"],[11,"id","lightweight"],[11,"class","docs-md__h2"],[9],[7,"a"],[11,"href","#lightweight"],[11,"class","heading-anchor"],[9],[0,"Lightweight"],[10],[10],[0,"\\n    "],[7,"p"],[9],[0,"Yeti table currently weights around "],[7,"code"],[9],[0,"6.17kb"],[10],[0," (minified and gzipped)."],[10],[0,"\\n\\n      "],[7,"h2"],[11,"id","why-yeti-"],[11,"class","docs-md__h2"],[9],[7,"a"],[11,"href","#why-yeti-"],[11,"class","heading-anchor"],[9],[0,"Why \\"Yeti\\"?"],[10],[10],[0,"\\n    "],[7,"p"],[9],[0,"YETI stands for \\"Yummy Ember Table Implementation\\" (let me know if you find better words for the acronym).\\nI also happen to like the sound of the \\"Yeti\\" word and we also have this little guy here:"],[10],[0,"\\n"],[7,"p"],[9],[1,[27,"svg-jar",["yeti"],[["width"],["100px"]]],false],[10],[10]],"hasEval":false}',meta:{moduleName:"dummy/pods/docs/why-yeti-table/template.hbs"}})
